BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `visible_contacts` (
	`_id`	INTEGER,
	PRIMARY KEY(`_id`)
);
CREATE TABLE IF NOT EXISTS `v1_settings` (
	`_id`	INTEGER,
	`_sync_account`	TEXT,
	`_sync_account_type`	TEXT,
	`key`	STRING NOT NULL,
	`value`	STRING,
	PRIMARY KEY(`_id`)
);
CREATE TABLE IF NOT EXISTS `stream_items` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`raw_contact_id`	INTEGER NOT NULL,
	`res_package`	TEXT,
	`icon`	TEXT,
	`label`	TEXT,
	`text`	TEXT,
	`timestamp`	INTEGER NOT NULL,
	`comments`	TEXT,
	`stream_item_sync1`	TEXT,
	`stream_item_sync2`	TEXT,
	`stream_item_sync3`	TEXT,
	`stream_item_sync4`	TEXT,
	FOREIGN KEY(`raw_contact_id`) REFERENCES `raw_contacts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `stream_item_photos` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`stream_item_id`	INTEGER NOT NULL,
	`sort_index`	INTEGER,
	`photo_file_id`	INTEGER NOT NULL,
	`stream_item_photo_sync1`	TEXT,
	`stream_item_photo_sync2`	TEXT,
	`stream_item_photo_sync3`	TEXT,
	`stream_item_photo_sync4`	TEXT,
	FOREIGN KEY(`stream_item_id`) REFERENCES `stream_items`(`_id`)
);
CREATE TABLE IF NOT EXISTS `status_updates` (
	`status_update_data_id`	INTEGER,
	`status`	TEXT,
	`status_ts`	INTEGER,
	`status_res_package`	TEXT,
	`status_label`	INTEGER,
	`status_icon`	INTEGER,
	PRIMARY KEY(`status_update_data_id`),
	FOREIGN KEY(`status_update_data_id`) REFERENCES `data`(`_id`)
);
CREATE TABLE IF NOT EXISTS `speed_dial` (
	`key_number`	INTEGER,
	`speed_dial_data_id`	INTEGER,
	PRIMARY KEY(`key_number`),
	FOREIGN KEY(`speed_dial_data_id`) REFERENCES `data`(`_id`)
);
CREATE TABLE IF NOT EXISTS `settings` (
	`account_name`	STRING NOT NULL,
	`account_type`	STRING NOT NULL,
	`data_set`	STRING,
	`ungrouped_visible`	INTEGER NOT NULL DEFAULT 0,
	`should_sync`	INTEGER NOT NULL DEFAULT 1
);
CREATE TABLE IF NOT EXISTS `search_index_stat` (
	`id`	INTEGER,
	`value`	BLOB,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `search_index_segments` (
	`blockid`	INTEGER,
	`block`	BLOB,
	PRIMARY KEY(`blockid`)
);
CREATE TABLE IF NOT EXISTS `search_index_segdir` (
	`level`	INTEGER,
	`idx`	INTEGER,
	`start_block`	INTEGER,
	`leaves_end_block`	INTEGER,
	`end_block`	INTEGER,
	`root`	BLOB,
	PRIMARY KEY(`level`,`idx`)
);
CREATE TABLE IF NOT EXISTS `search_index_docsize` (
	`docid`	INTEGER,
	`size`	BLOB,
	PRIMARY KEY(`docid`)
);
CREATE TABLE IF NOT EXISTS `search_index_content` (
	`docid`	INTEGER,
	`c0contact_id`	TEXT,
	`c1content`	TEXT,
	`c2name`	TEXT,
	`c3tokens`	TEXT,
	PRIMARY KEY(`docid`)
);
CREATE VIRTUAL TABLE search_index USING FTS4 (contact_id INTEGER REFERENCES contacts(_id) NOT NULL,content TEXT, name TEXT, tokens TEXT);
CREATE TABLE IF NOT EXISTS `roaming` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`number`	TEXT NOT NULL UNIQUE,
	`incoming_cnt`	INTEGER DEFAULT 0,
	`incoming_duration`	INTEGER DEFAULT 0,
	`outgoing_cnt`	INTEGER DEFAULT 0,
	`outgoing_duration`	INTEGER DEFAULT 0,
	`contact_name`	TEXT,
	`contact_e164`	TEXT,
	`countryiso`	TEXT,
	`type`	INTEGER,
	`score`	INTEGER,
	`last_score`	INTEGER,
	`last_duration`	INTEGER,
	`date`	INTEGER
);
CREATE TABLE IF NOT EXISTS `raw_contacts` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`is_restricted`	INTEGER DEFAULT 0,
	`account_id`	INTEGER,
	`sourceid`	TEXT,
	`raw_contact_is_read_only`	INTEGER NOT NULL DEFAULT 0,
	`version`	INTEGER NOT NULL DEFAULT 1,
	`dirty`	INTEGER NOT NULL DEFAULT 0,
	`deleted`	INTEGER NOT NULL DEFAULT 0,
	`contact_id`	INTEGER,
	`aggregation_mode`	INTEGER NOT NULL DEFAULT 0,
	`aggregation_needed`	INTEGER NOT NULL DEFAULT 1,
	`custom_ringtone`	TEXT,
	`send_to_voicemail`	INTEGER NOT NULL DEFAULT 0,
	`times_contacted`	INTEGER NOT NULL DEFAULT 0,
	`last_time_contacted`	INTEGER,
	`starred`	INTEGER NOT NULL DEFAULT 0,
	`pinned`	INTEGER NOT NULL DEFAULT 0,
	`display_name`	TEXT,
	`display_name_alt`	TEXT,
	`display_name_source`	INTEGER NOT NULL DEFAULT 0,
	`phonetic_name`	TEXT,
	`phonetic_name_style`	TEXT,
	`sort_key`	TEXT,
	`phonebook_label`	TEXT,
	`phonebook_bucket`	INTEGER,
	`sort_key_alt`	TEXT,
	`phonebook_label_alt`	TEXT,
	`phonebook_bucket_alt`	INTEGER,
	`name_verified`	INTEGER NOT NULL DEFAULT 0,
	`sync1`	TEXT,
	`sync2`	TEXT,
	`sync3`	TEXT,
	`sync4`	TEXT,
	`creation_time`	LONG NOT NULL DEFAULT 0,
	`sec_custom_vibration`	TEXT,
	`sec_custom_alert`	TEXT,
	`is_private`	INTEGER NOT NULL DEFAULT 0,
	`backup_id`	TEXT,
	`sec_recently`	INTERGER NOT NULL DEFAULT 1,
	`sec_led`	TEXT,
	`metadata_dirty`	INTEGER NOT NULL DEFAULT 0,
	FOREIGN KEY(`contact_id`) REFERENCES `contacts`(`_id`),
	FOREIGN KEY(`account_id`) REFERENCES `accounts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `properties` (
	`property_key`	TEXT,
	`property_value`	TEXT,
	PRIMARY KEY(`property_key`)
);
CREATE TABLE IF NOT EXISTS `presence` (
	`presence_data_id`	INTEGER,
	`protocol`	INTEGER NOT NULL,
	`custom_protocol`	TEXT,
	`im_handle`	TEXT,
	`im_account`	TEXT,
	`presence_contact_id`	INTEGER,
	`presence_raw_contact_id`	INTEGER,
	`mode`	INTEGER,
	`chat_capability`	INTEGER NOT NULL DEFAULT 0,
	FOREIGN KEY(`presence_contact_id`) REFERENCES `contacts`(`_id`),
	FOREIGN KEY(`presence_raw_contact_id`) REFERENCES `raw_contacts`(`_id`),
	UNIQUE(`protocol`,`custom_protocol`,`im_handle`,`im_account`),
	PRIMARY KEY(`presence_data_id`),
	FOREIGN KEY(`presence_data_id`) REFERENCES `data`(`_id`)
);
CREATE TABLE IF NOT EXISTS `pre_authorized_uris` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`uri`	STRING NOT NULL,
	`expiration`	INTEGER NOT NULL DEFAULT 0
);
CREATE TABLE IF NOT EXISTS `photo_files` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`height`	INTEGER NOT NULL,
	`width`	INTEGER NOT NULL,
	`filesize`	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS `phone_lookup` (
	`data_id`	INTEGER NOT NULL,
	`raw_contact_id`	INTEGER NOT NULL,
	`normalized_number`	TEXT NOT NULL,
	`min_match`	TEXT NOT NULL,
	FOREIGN KEY(`data_id`) REFERENCES `data`(`_id`),
	FOREIGN KEY(`raw_contact_id`) REFERENCES `raw_contacts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `packages` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`package`	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS `nickname_lookup` (
	`name`	TEXT,
	`cluster`	TEXT
);
CREATE TABLE IF NOT EXISTS `name_lookup` (
	`data_id`	INTEGER NOT NULL,
	`raw_contact_id`	INTEGER NOT NULL,
	`normalized_name`	TEXT NOT NULL,
	`name_type`	INTEGER NOT NULL,
	PRIMARY KEY(`data_id`,`normalized_name`,`name_type`),
	FOREIGN KEY(`data_id`) REFERENCES `data`(`_id`),
	FOREIGN KEY(`raw_contact_id`) REFERENCES `raw_contacts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `mimetypes` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`mimetype`	TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS `metadata_sync_state` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`account_id`	INTEGER NOT NULL,
	`state`	BLOB
);
CREATE TABLE IF NOT EXISTS `metadata_sync` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`raw_contact_backup_id`	TEXT NOT NULL,
	`account_id`	INTEGER NOT NULL,
	`data`	TEXT,
	`deleted`	INTEGER NOT NULL DEFAULT 0
);
CREATE TABLE IF NOT EXISTS `location` (
	`data_id`	INTEGER NOT NULL,
	`raw_contact_id`	INTEGER NOT NULL,
	`number`	TEXT,
	`pnl`	TEXT,
	FOREIGN KEY(`data_id`) REFERENCES `data`(`_id`),
	FOREIGN KEY(`raw_contact_id`) REFERENCES `raw_contacts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `kids` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`kids_id`	INTEGER,
	`contact_id`	INTEGER,
	`favorite`	INTEGER NOT NULL DEFAULT 0,
	`screen_name`	TEXT,
	`number_data_id`	INTEGER,
	`photo_id`	INTEGER,
	FOREIGN KEY(`number_data_id`) REFERENCES `data`(`_id`),
	FOREIGN KEY(`contact_id`) REFERENCES `contacts`(`_id`),
	FOREIGN KEY(`photo_id`) REFERENCES `data`(`_id`)
);
CREATE TABLE IF NOT EXISTS `groups` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`package_id`	INTEGER,
	`account_id`	INTEGER,
	`sourceid`	TEXT,
	`version`	INTEGER NOT NULL DEFAULT 1,
	`dirty`	INTEGER NOT NULL DEFAULT 0,
	`title`	TEXT,
	`title_res`	INTEGER,
	`notes`	TEXT,
	`system_id`	TEXT,
	`deleted`	INTEGER NOT NULL DEFAULT 0,
	`group_visible`	INTEGER NOT NULL DEFAULT 0,
	`should_sync`	INTEGER NOT NULL DEFAULT 1,
	`auto_add`	INTEGER NOT NULL DEFAULT 0,
	`favorites`	INTEGER NOT NULL DEFAULT 0,
	`group_is_read_only`	INTEGER NOT NULL DEFAULT 0,
	`sync1`	TEXT,
	`sync2`	TEXT,
	`sync3`	TEXT,
	`sync4`	TEXT,
	`custom_ringtone`	TEXT,
	`group_order`	STRING DEFAULT NULL,
	`creation_time`	LONG NOT NULL DEFAULT 0,
	`sec_custom_vibration`	TEXT,
	`sec_custom_alert`	TEXT,
	`sec_custom_dormant_group`	INTEGER NOT NULL DEFAULT 0,
	FOREIGN KEY(`account_id`) REFERENCES `accounts`(`_id`),
	FOREIGN KEY(`package_id`) REFERENCES `package`(`_id`)
);
CREATE TABLE IF NOT EXISTS `emergency` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`name`	TEXT,
	`number`	TEXT,
	`default_emergency`	INTEGER,
	`phone_data_id`	INTEGER,
	`emergency_order`	INTEGER DEFAULT 0
);
CREATE TABLE IF NOT EXISTS `directories` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`packageName`	TEXT NOT NULL,
	`authority`	TEXT NOT NULL,
	`typeResourceId`	INTEGER,
	`typeResourceName`	TEXT,
	`accountType`	TEXT,
	`accountName`	TEXT,
	`displayName`	TEXT,
	`exportSupport`	INTEGER NOT NULL DEFAULT 0,
	`shortcutSupport`	INTEGER NOT NULL DEFAULT 0,
	`photoSupport`	INTEGER NOT NULL DEFAULT 0
);
CREATE TABLE IF NOT EXISTS `dialer_keypad_lookup` (
	`raw_contact_id`	INTEGER NOT NULL,
	`action_code`	TEXT NOT NULL,
	`action_code_alt`	TEXT NOT NULL,
	`action_code_type`	INTEGER NOT NULL,
	PRIMARY KEY(`raw_contact_id`),
	FOREIGN KEY(`raw_contact_id`) REFERENCES `raw_contacts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `deleted_contacts` (
	`contact_id`	INTEGER,
	`contact_deleted_timestamp`	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY(`contact_id`)
);
CREATE TABLE IF NOT EXISTS `default_directory` (
	`_id`	INTEGER,
	PRIMARY KEY(`_id`)
);
CREATE TABLE IF NOT EXISTS `data_usage_stat` (
	`stat_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`data_id`	INTEGER NOT NULL,
	`usage_type`	INTEGER NOT NULL DEFAULT 0,
	`times_used`	INTEGER NOT NULL DEFAULT 0,
	`last_time_used`	INTERGER NOT NULL DEFAULT 0,
	FOREIGN KEY(`data_id`) REFERENCES `data`(`_id`)
);
CREATE TABLE IF NOT EXISTS `data` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`package_id`	INTEGER,
	`mimetype_id`	INTEGER NOT NULL,
	`raw_contact_id`	INTEGER NOT NULL,
	`is_read_only`	INTEGER NOT NULL DEFAULT 0,
	`is_primary`	INTEGER NOT NULL DEFAULT 0,
	`is_super_primary`	INTEGER NOT NULL DEFAULT 0,
	`data_version`	INTEGER NOT NULL DEFAULT 0,
	`data1`	TEXT,
	`data2`	TEXT,
	`data3`	TEXT,
	`data4`	TEXT,
	`data5`	TEXT,
	`data6`	TEXT,
	`data7`	TEXT,
	`data8`	TEXT,
	`data9`	TEXT,
	`data10`	TEXT,
	`data11`	TEXT,
	`data12`	TEXT,
	`data13`	TEXT,
	`data14`	TEXT,
	`data15`	TEXT,
	`data_sync1`	TEXT,
	`data_sync2`	TEXT,
	`data_sync3`	TEXT,
	`data_sync4`	TEXT,
	`hash_id`	TEXT,
	`carrier_presence`	INTEGER NOT NULL DEFAULT 0,
	FOREIGN KEY(`raw_contact_id`) REFERENCES `raw_contacts`(`_id`),
	FOREIGN KEY(`package_id`) REFERENCES `package`(`_id`),
	FOREIGN KEY(`mimetype_id`) REFERENCES `mimetype`(`_id`)
);
