CREATE TABLE IF NOT EXISTS `contacts` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`name_raw_contact_id`	INTEGER,
	`photo_id`	INTEGER,
	`photo_file_id`	INTEGER,
	`custom_ringtone`	TEXT,
	`send_to_voicemail`	INTEGER NOT NULL DEFAULT 0,
	`times_contacted`	INTEGER NOT NULL DEFAULT 0,
	`last_time_contacted`	INTEGER,
	`starred`	INTEGER NOT NULL DEFAULT 0,
	`pinned`	INTEGER NOT NULL DEFAULT 0,
	`has_phone_number`	INTEGER NOT NULL DEFAULT 0,
	`lookup`	TEXT,
	`status_update_id`	INTEGER,
	`contact_last_updated_timestamp`	INTEGER,
	`single_is_restricted`	INTEGER NOT NULL DEFAULT 0,
	`dirty_contact`	INTEGER NOT NULL DEFAULT 0,
	`has_email`	INTEGER NOT NULL DEFAULT 0,
	`link_count`	INTEGER,
	`sec_custom_vibration`	TEXT,
	`sec_custom_dormant_contact`	INTEGER NOT NULL DEFAULT 0,
	`sec_custom_alert`	TEXT,
	`link_accounts`	TEXT,
	`is_private`	INTEGER NOT NULL DEFAULT 0,
	`sec_led`	TEXT,
	FOREIGN KEY(`photo_id`) REFERENCES `data`(`_id`),
	FOREIGN KEY(`photo_file_id`) REFERENCES `photo_files`(`_id`),
	FOREIGN KEY(`name_raw_contact_id`) REFERENCES `raw_contacts`(`_id`),
	FOREIGN KEY(`status_update_id`) REFERENCES `data`(`_id`)
);
CREATE TABLE IF NOT EXISTS `android_metadata` (
	`locale`	TEXT
);
CREATE TABLE IF NOT EXISTS `agg_presence` (
	`presence_contact_id`	INTEGER,
	`mode`	INTEGER,
	`chat_capability`	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY(`presence_contact_id`),
	FOREIGN KEY(`presence_contact_id`) REFERENCES `contacts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `agg_exceptions` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`type`	INTEGER NOT NULL,
	`raw_contact_id1`	INTEGER,
	`raw_contact_id2`	INTEGER,
	FOREIGN KEY(`raw_contact_id1`) REFERENCES `raw_contacts`(`_id`),
	FOREIGN KEY(`raw_contact_id2`) REFERENCES `raw_contacts`(`_id`)
);
CREATE TABLE IF NOT EXISTS `accounts` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`account_name`	TEXT,
	`account_type`	TEXT,
	`data_set`	TEXT
);
CREATE TABLE IF NOT EXISTS `_sync_state_metadata` (
	`version`	INTEGER
);
CREATE TABLE IF NOT EXISTS `_sync_state` (
	`_id`	INTEGER,
	`account_name`	TEXT NOT NULL,
	`account_type`	TEXT NOT NULL,
	`data`	TEXT,
	UNIQUE(`account_name`,`account_type`),
	PRIMARY KEY(`_id`)
);
